import React from "react";
import {Container, Row, Col} from 'react-bootstrap';
import './CSS/Footer.css';
import Logos from "./Images/Logos.png";

function Footer() {
    return (
        <>

        <Container className="c footer" fluid>
    <Row>
        <Col>
            <img src={Logos} width="200" height="200" alt="logo"/>
        </Col>
        <Col>
            <Row>Home</Row>
            <Row style={{paddingTop:"1vw"}}>Search</Row>
            <Row style={{paddingTop:"1vw"}}>Stories</Row> 
            <Row style={{paddingTop:"1vw"}}>Contact Us</Row>
        </Col>
        <Col>
            <Col>Follow Us</Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/fluent/64/000000/instagram-new.png" width="5%" /> @thedatanecdotes </Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/color/48/000000/twitter.png" width="5%"/> @thedatanecdotes </Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/cute-clipart/64/000000/github.png" width="5%"/>@thedatanecdotes</Col>
        </Col>
    </Row>


        </Container>

        </>
    );
}
export default Footer;
